import React from 'react';
import './App.css';
import './EmployeeInfoForm.css';

import {Button, FormGroup} from 'react-bootstrap'
function App() {
  return (
    <form className="employee-info-form">
      <h2>Employee Info </h2>
      <FormGroup>
        <div className="name">
          <input type = "text" className="firstname" id = "firstname" placeholder = "Firstname"/>
          <input type = "text" className="lastname" id = "lastname" placeholder = "Lastname"/>
        </div>
        <div className="salary">
          <input type="number" className="annualsalary" id="annualsalary" placeholder = "Annual Salary" />
          <input type="number" className="superrate" id="superrate" placeholder = "Super Rate" />
      </div>
      </FormGroup>
      <div className="button">
        <Button variant='primary'>Generate Payslip</Button>
        </div>
    </form>
  );
}

export default App;
